import styles from "../Form/Form.module.css";

export default function Form(props) {
  return (
    <form>
      <label htmlFor="">Username: </label>
      <input type="text" />
      <label htmlFor="">Password: </label>
      <input type="password" />
      <button>Login</button>
    </form>
  );
}
